import { Howl, Howler } from 'howler';

    // Game State
    const gameState = {
      currentLevel: 1,
      isPlaying: false,
      scareTriggered: false,
    };

    // DOM Elements
    const screens = {
      mainMenu: document.getElementById('main-menu'),
      game: document.getElementById('game'),
    };

    const elements = {
      timer: document.getElementById('timer'),
      spaceship: document.getElementById('spaceship'),
      asteroids: document.getElementById('asteroids'),
    };

    // Preload Scary Image
    const scaryImage = new Image();
    scaryImage.src = 'data:image/jpg;base64,'; // Paste your base64 here

    // Preload Scream Sound
    const screamSound = new Howl({
      src: ['data:audio/mp3;base64,PASTE_SCREAM_MP3_HERE'], 
      preload: true,
      onloaderror: () => console.error('Failed to load scream sound'),
    });

    // Start Game
    function startGame() {
      gameState.currentLevel = 1;
      gameState.isPlaying = true;
      gameState.scareTriggered = false;
      showScreen(screens.game);
      startLevel();
    }

    // Start Level
    function startLevel() {
      const gameContainer = document.getElementById('game');
      gameContainer.className = `level${gameState.currentLevel}`;

      // Level Logic
      setTimeout(() => {
        if (gameState.currentLevel === 3) {
          triggerScare();
        }
      }, 12500); // Trigger scare halfway through level 3 (25s level)
    }

    // Trigger Scare
    function triggerScare() {
      if (gameState.scareTriggered) return;

      // Show Scary Image
      const scaryFace = document.createElement('div');
      scaryFace.className = 'scary-face';
      screens.game.appendChild(scaryFace);

      // Play Scream Sound
      screamSound.play();

      gameState.scareTriggered = true;
    }

    // Event Listeners
    document.getElementById('play').addEventListener('click', startGame);
